INSERT INTO `Item` VALUES (22, 2, '', '', '# 是否开启自我保护模式。默认开启 (可能由于网络抖动造成Client向Server发送心跳失败，但服务实例是健康的。', 21, b'0', 'apollo', '2020-05-15 11:49:27', 'apollo', '2020-05-15 11:49:27');
INSERT INTO `Item` VALUES (23, 2, '', '', '# 当出现大范围误判，可能导致注册的服务发范围被剔除。SELF PRESERVATION机制保证当一分钟内收到的续约次数小于指定伐值，', 22, b'0', 'apollo', '2020-05-15 11:49:27', 'apollo', '2020-05-15 11:49:27');
INSERT INTO `Item` VALUES (24, 2, '', '', '# 则禁止定时任务剔除失效实例。开发测试环境，开启该机制反而可能会影响系统的持续集成)', 23, b'0', 'apollo', '2020-05-15 11:49:27', 'apollo', '2020-05-15 11:49:27');
INSERT INTO `Item` VALUES (25, 2, 'eureka.server.enable-self-preservation', 'false', '', 24, b'0', 'apollo', '2020-05-15 11:49:27', 'apollo', '2020-05-15 11:49:27');
INSERT INTO `Item` VALUES (26, 2, '', '', '# 触发自我保护的伐值因子，默认0.85 (该值可在生产环境下适当调小，防止频繁触发自我保护)', 25, b'0', 'apollo', '2020-05-15 11:49:27', 'apollo', '2020-05-15 11:49:27');
INSERT INTO `Item` VALUES (27, 2, 'eureka.server.renewal-percent-threshold', '0.85', '', 26, b'0', 'apollo', '2020-05-15 11:49:27', 'apollo', '2020-05-15 11:49:27');
INSERT INTO `Item` VALUES (28, 2, '', '', '# Eureka服务器获取不到集群里对等服务器上的实例时，多久不对外提供注册服务', 27, b'0', 'apollo', '2020-05-15 11:49:27', 'apollo', '2020-05-15 11:49:27');
